// RANGE SLIDER
if (rangeSlider) {
  noUiSlider.create(rangeSlider, {
    start: [13, 9999],
    connect: true,
    step: 1,
    range: {
      'min': [13],
      '10%': [50],
      '20%': [300],
      '40%': [1200],
      'max': [9999]
    }
  });

  rangeSlider.noUiSlider.on('update', function(values, handle) {
    inputs[handle].value = Math.round(values[handle]);
  });

  const setRangeSlider = (i, value) => {
    let arr = [null, null];
    arr[i] = value;

    rangeSlider.noUiSlider.set(arr);
  };

  inputs.forEach((el, index) => {
    el.addEventListener('change', (e) => {
      setRangeSlider(index, e.currentTarget.value);
    });
  });
};

// PRODUCTS
const loadMore = document.querySelector('.products__more')

let quantityProducts = 8
let dataLength = ''

if (loadMore) {
  const fetchProducts = (quantity = 8) => {
    fetch('products.json')
    .then((response) => {
      return response.json();
    })
    .then((data) => {
      dataLength = data.length;
      productsListGrid.innerHTML = '';
      for (let i = 0; i < data.length; i++) {
        if (i < quantity) {
          productsListGrid.innerHTML += `
            <article class="products__item">
              <div class="products__top">
                <div class="products__overlay overlay">
                  <button class="overlay__icon__wrapper" aria-label="Add To Wishlist">
                    <svg class="overlay__icon overlay__icon--heart">
                      <use href="images/icons/sprite.svg#heart" />
                    </svg>
                  </button>
      
                  <button class="overlay__icon__wrapper btn--cart" aria-label="Add To Cart" onclick="getItemToCart()">
                    <svg class="overlay__icon">
                      <use href="images/icons/sprite.svg#cart-2" />
                    </svg>
                  </button>
                </div>
                
                <picture class="products__img">
                  <source data-srcset="${data[i].imagewebp}" srcset="${data[i].imagewebp}" type="image/webp">
                  <img class="lazy" data-src="${data[i].image}" src="${data[i].image}" alt="${data[i].title}" width="236"
                    height="153">
                </picture>
              </div>
      
              <div class="products__content">
                <a href="card.html"><h3 class="products__name">${data[i].title}</h3></a>
                <div class="products__rate">★ ★ ★ ★ ★</div>
                <div class="products__prices">
                  <span class="products__price">$${data[i].price}</span>
                  <span class="products__price products__price--old">$599</span>
                </div>
              </div>
            </article>
          `;
        }
      }
    });
  };
  
  fetchProducts(quantityProducts)
  
  loadMore.addEventListener('click', (e) => {
    quantityProducts = quantityProducts + 4;
    fetchProducts(quantityProducts);
  
    if (quantityProducts == dataLength) {
      loadMore.style.display = 'none';
    } else {
      loadMore.style.display = 'block';
    }
  });
}
;

// TABS
productsTab.forEach((link) => {
  link.addEventListener('click', () => {
    productsTab.forEach((item) => {
      item.classList.remove('active')
    })

    link.classList.add('active')
  })
});

// LIST-GRID VIEWS
viewBtn.forEach((link) => {
  link.addEventListener('click', () => {
    viewBtn.forEach((item) => {
      item.classList.remove('active')
    })

    link.classList.add('active')

    productsList.forEach((view) => {
      view.style.display = "none"
    })

    let viewMode = link.getAttribute('data-view')

    if (viewMode == 'list-view') {
      document.querySelector('.' + viewMode).style.display = "grid"
    } else {
      document.querySelector('.' + viewMode).style.display = "grid"
    }
  })
});

// COLOR SELECT
colorBox.forEach((el) => {
  el.addEventListener('click', () => {
    colorBox.forEach((el) => {
      el.classList.remove('active')
    }) 

    el.classList.add('active')
  })
});

// CARD SLIDER
if (cardSliderImg) {
  cardSliderThumbs.addEventListener('mouseover', (e) => {
    if (e.target.classList.contains('cardSlider__thumb')) {
      let src = e.target.querySelector('picture img').getAttribute('src')
      cardSliderImg.setAttribute('srcset', src)
    }
  })
  
  cardSliderThumb.forEach((thumb) => {
    thumb.addEventListener('mouseover', () => {
      cardSliderThumb.forEach((el) => {
        el.classList.remove('active')
      });
    
      thumb.classList.add('active')
    })
  });
}
;

// CARD TABS
cardTab.forEach((tab) => {
  tab.addEventListener('click', () => {
    cardTab.forEach((el) => {
      el.classList.remove('active')
    })

    tab.classList.add('active')

    cardInfo.forEach((view) => {
      view.style.display = "none"
    })

    let activeView = tab.getAttribute('data-view')

    if (activeView == !'desc') {
      document.querySelector('.' + activeView).style.display = "block"
    } else {
      document.querySelector('.' + activeView).style.display = "block"
    }
  })
});

// CARD TABS
if (sidebannersSlider) {
  new Swiper(sidebannersSlider, {
    speed: 400,
    slidesPerView: 1,
    spaceBetween: 10,
    width: 270,
    autoplay: {
      delay: 8000,
      disableOnInteraction: true,
    },
    pagination: {
      el: '.sidebanners__pagination',
      clickable: true,
    }
  });
};

// COUNTER
const counterInput = document.querySelector('.counter__input'),
      counterPlus = document.querySelector('.counter__btn--plus'),
      counterMinus = document.querySelector('.counter__btn--minus'),
      addToCart = document.querySelectorAll('.btn--cart'),
      qtyItemsCart = document.querySelector('.nav__itemsqty'),
      costItemsCart = document.querySelector('.nav__cost')

if (counterInput) {
  counterPlus.addEventListener('click', () => {
    let currentValue = parseInt(counterInput.value)
    currentValue++
    counterInput.value = currentValue

    counterMinus.classList.remove('disabled')

    if (counterInput.value > 99998) {
      counterInput.value = 99999
      counterPlus.classList.add('disabled')
    } else {
      counterPlus.classList.remove('disabled')
    }
  })

  counterMinus.addEventListener('click', () => {
    let currentValue = parseInt(counterInput.value)
    currentValue--
    counterInput.value = currentValue

    counterPlus.classList.remove('disabled')

    if (counterInput.value <= 1) {
      counterInput.value = 1
      counterMinus.classList.add('disabled')
    } else {
      counterMinus.classList.remove('disabled')
    }
  })
}

qtyItemsCart.value = 0

function getItemToCart() {
  if (counterInput && counterInput.value > 2) {
    qtyItemsCart.value += Number(counterInput.value)
  } else {
    qtyItemsCart.value++
  }

  costItemsCart.value = qtyItemsCart.value * 499

  if (qtyItemsCart.value > 99) {
    qtyItemsCart.textContent = 99 + ' Items' + '+'
  } else {
    qtyItemsCart.textContent = qtyItemsCart.value + ' Items'
  }

  if (costItemsCart.value > 9999) {
    costItemsCart.textContent = '$' + 9999 + '+';
  } else {
    costItemsCart.textContent = '$' + costItemsCart.value
  }
};

// RATER
const comments = document.getElementById('comments')

if (comments) {
  const ACTION = {
    PLUS: 'plus',
    MINUS: 'minus'
  }
  
  const calculateRate = (commentItem, action) => {
    const input = commentItem.querySelector('.rater__input')
  
    switch (action) {
      case ACTION.PLUS:
        input.value++
        break
      case ACTION.MINUS:
        input.value--
        break
    }
  }
  
  comments.addEventListener('click', (event) => {
    if (event.target.classList.contains('rater__btn--minus')) {
      calculateRate(
        event.target.closest('.comments__item'),
        ACTION.MINUS
      )
    }
    if (event.target.classList.contains('rater__btn--plus')) {
      calculateRate(
        event.target.closest('.comments__item'),
        ACTION.PLUS
      )
    }
  })
}
;

// CART
const cart = document.getElementById('cart')

if (cart) {
  const subTotalPriceWrapper = document.getElementById('subtotalPrice'),
        totalPriceWrapper = document.getElementById('totalPrice');
  
  const ACTION = {
    CLEAR: 'clear',
    PLUS: 'plus',
    MINUS: 'minus'
  }
  
  const getItemSubTotalPrice = (input) => Number(input.value) * Number(input.dataset.price);
  
  let totalPrice = 0,
      shippingFee = 20,
      subtotalPrice = 0;
  
  const init = () => {
    [...document.querySelectorAll('.cartProduct')].forEach((cartItem) => {
      subtotalPrice += getItemSubTotalPrice(cartItem.querySelector('.stepper__input'))
      totalPrice = subtotalPrice + shippingFee
    });
  
    setSubTotalPrice(subtotalPrice)
    setTotalPrice(totalPrice)
  }
  
  const setSubTotalPrice = (value) => {
    subTotalPriceWrapper.textContent = '$' + value;
    subTotalPriceWrapper.dataset.value = value;
  }
  
  const setTotalPrice = (value) => {
    totalPriceWrapper.textContent = '$' + value;
    totalPriceWrapper.dataset.value = value;
  }
  
  const calculateSeparateItem = (cartItem, action) => {
    const input = cartItem.querySelector('.stepper__input'),
          plus = cartItem.querySelector('.stepper__btn--plus')
  
    switch (action) {
      case ACTION.CLEAR:
        cartItem.remove()
        setSubTotalPrice(subTotalPriceWrapper.textContent = Number(subTotalPriceWrapper.dataset.value) - getItemSubTotalPrice(input))
        setTotalPrice(totalPriceWrapper.textContent = Number(subTotalPriceWrapper.dataset.value) + shippingFee)
        break
      case ACTION.PLUS:
        input.value++
        setSubTotalPrice(subTotalPriceWrapper.textContent = Number(subTotalPriceWrapper.dataset.value) + Number(input.dataset.price))
        setTotalPrice(totalPriceWrapper.textContent = Number(subTotalPriceWrapper.dataset.value) + shippingFee)
        break
      case ACTION.MINUS:
        input.value--
        setSubTotalPrice(subTotalPriceWrapper.textContent = Number(subTotalPriceWrapper.dataset.value) - Number(input.dataset.price))
        setTotalPrice(totalPriceWrapper.textContent = Number(subTotalPriceWrapper.dataset.value) + Number(shippingFee))
        break
    }
  
    if (input.value > 99998) {
      input.value = 99999;
      plus.classList.add('disabled')
    } else {
      plus.classList.remove('disabled')
    }
  
    if (input.value <= 0) {
      cartItem.remove()
    }
  
    cartItem.querySelector('.cartProduct__price').textContent = '$' + getItemSubTotalPrice(input)
  }
  
  cart.addEventListener('click', (event) => {
    if (event.target.classList.contains('cartProduct__clear')) {
      calculateSeparateItem(
        event.target.closest('.cartProduct'),
        ACTION.CLEAR
      )
    }
    if (event.target.classList.contains('stepper__btn--minus')) {
      calculateSeparateItem(
        event.target.closest('.cartProduct'),
        ACTION.MINUS
      )
    }
    if (event.target.classList.contains('stepper__btn--plus')) {
      calculateSeparateItem(
        event.target.closest('.cartProduct'),
        ACTION.PLUS
      )
    }
  })
  
  init();  
};
